const colors = {
  mainColor: "rgb(197, 211, 235)",
  sectionBackgroundColor: "rgb(250, 250, 250)",
  userBackgroundColor: "rgb(248, 248, 248)",
  imgBackgroundColor: "rgb(235, 235, 235)",
  womenBorderColor: "rgb(255, 128, 240)",
  menBorderColor: "rgb(55, 37, 250)",
  cardButtonActive: "rgb(100,100,100)",
  cardButtonOff: "rgb(0, 0, 0)",
  buttonActiveColor: "green",
  buttonOffColor: "red"
};

export default colors;
